--  DDL for Trigger ADJUSTMENTDETAIL_COP_ADJ_DT__1
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "IDCMSCORE"."ADJUSTMENTDETAIL_COP_ADJ_DT__1" BEFORE INSERT OR UPDATE ON adjustmentdetail
FOR EACH ROW
DECLARE 
v_newVal NUMBER(12) := 0;
v_incval NUMBER(12) := 0;
BEGIN
  IF INSERTING AND :new.cop_adj_dt_uniqueId IS NULL THEN
    SELECT  adjustmentdetail_cop_adj_dt_un.NEXTVAL INTO v_newVal FROM DUAL;
    -- If this is the first time this table have been inserted into (sequence == 1)
    IF v_newVal = 1 THEN 
      --get the max indentity value from the table
      SELECT NVL(max(cop_adj_dt_uniqueId),0) INTO v_newVal FROM adjustmentdetail;
      v_newVal := v_newVal + 1;
      --set the sequence to that value
      LOOP
           EXIT WHEN v_incval>=v_newVal;
           SELECT adjustmentdetail_cop_adj_dt_un.nextval INTO v_incval FROM dual;
      END LOOP;
    END IF;
    --used to emulate LAST_INSERT_ID()
    --mysql_utilities.identity := v_newVal; 
   -- assign the value from the sequence to emulate the identity column
   :new.cop_adj_dt_uniqueId := v_newVal;
  END IF;
END;
/
ALTER TRIGGER "IDCMSCORE"."ADJUSTMENTDETAIL_COP_ADJ_DT__1" ENABLE;
