--  DDL for Trigger ADJUSTMENTDETAIL_MOD_ETRG
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "IDCMSCORE"."ADJUSTMENTDETAIL_MOD_ETRG" 
BEFORE INSERT OR UPDATE ON adjustmentdetail
FOR EACH ROW
DECLARE
  v_val adjustmentdetail.mod%TYPE;
  v_test adjustmentdetail.mod%TYPE;
BEGIN
  v_val := 'D';
  v_test := TRIM(:new.mod);
  if v_test = '1' OR v_test = 'D' THEN 
  v_val := 'D';
  elsif v_test = '2' OR v_test = 'C' THEN 
  v_val := 'C';
  end if;  :new.mod := v_val;
END;
/
ALTER TRIGGER "IDCMSCORE"."ADJUSTMENTDETAIL_MOD_ETRG" ENABLE;
