--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "IDCMSCORE"."LEAFAPPROVALFBMOZNVALENUM_ETRG" 
BEFORE INSERT OR UPDATE ON leafapproval
FOR EACH ROW
DECLARE
  v_val leafapproval.leafApprovalEnum%TYPE;
  v_test leafapproval.leafApprovalEnum%TYPE;
BEGIN
  v_val := 'S';
  v_test := TRIM(:new.leafApprovalEnum);
  if v_test = '1' OR v_test = 'S' THEN 
  v_val := 'S';
  elsif v_test = '2' OR v_test = 'G' THEN 
  v_val := 'G';
  end if;  :new.leafApprovalEnum := v_val;
END;
/
