--  DDL for Trigger LOGADVANCE_LOGADVANCETYPE_ETRG
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "IDCMSCORE"."LOGADVANCE_LOGADVANCETYPE_ETRG" 
BEFORE INSERT OR UPDATE ON logadvance
FOR EACH ROW
DECLARE
  v_val logadvance.logAdvanceType%TYPE;
  v_test logadvance.logAdvanceType%TYPE;
BEGIN
  v_val := 'C';
  v_test := TRIM(:new.logAdvanceType);
  if v_test = '1' OR v_test = 'C' THEN 
  v_val := 'C';
  elsif v_test = '2' OR v_test = 'U' THEN 
  v_val := 'U';
  elsif v_test = '3' OR v_test = 'D' THEN 
  v_val := 'D';
  end if;  :new.logAdvanceType := v_val;
END;
/
